import React from 'react'
import '../styles/about.css'

export default function About({firstName}) {
    let property 
    if(firstName){
        property = firstName
    }
    else{
        property = "join us"
    }

  return (
    <div className="container">
      <div>
      <img src="/harmburger.svg" />
      </div>
      <div>shopperbird</div>
      <div>
      <span>{property}</span>&nbsp; &nbsp;
      <span><img src="user.svg" /></span>

    </div>

    </div>
  )
}
